            <div class="entry-info">
                <h1 class="entry-title">Teneille &#038; Michael</h1>
                <h2 class="entry-subtitle">A wedding at the park, featuring our Serena Gown</h2>
            </div>
            <div class="entry-content">
                <div class="sections">
                    <div class="section-text">
                        <div class="section-text-container">
                            <div class="section-text-row">
                                <div class="section-text-col">
                                    <div class="section-text-content">
                                        <p style="text-align: center;">Teneille and Michael first met in elementary school. By the ninth grade, he was saving Teneille a seat on the bus every day and they later would become &#8220;high school sweethearts&#8221;.</p>
                                        <p style="text-align: center;">They had just been in their first home together for a little over a year when Michael surprised Teneille with a wooden advent calendar on December 1st. Every day that month she received a thoughtful gift leading up to Christmas Eve. That evening when she opened up the 24th door she discovered a beautiful diamond ring and turned around to see Michael on one knee in a Christmas onesie.</p>
                                        <p style="text-align: center;">Teneille chose our Serena Gown for her special day. &#8220;The moment I put it on I knew it was the dress for me. It was so classy and elegant and unlike any other wedding gown I had looked at. The beading and detail made me fall in love. I actually was not planning on doing any wedding gown shopping while in Vancouver but my mom really wanted to go! I booked an appointment and I had a really clear vision of what I wanted my dress to look like but as I was trying them on I just did not love any of them. The gal at Bisou (Nathalie) who was helping us asked if she could pull a few dresses that she thought would look good on me and the Serena was one of them! My mom and I were both obsessed with it!&#8221;</p>
                                        <p style="text-align: center;">Teneille and Michael got married on August 17th 2019. The ceremony took place at a park beside her parents&#8217; house, which overlooked the river in the city. Their reception was at the Albert Community Center Loft where they shared lots of laughs, danced, and celebrated their love.</p>
                                        <p style="text-align: center;">Congrats to these highschool sweethearts!</p>
